import React from 'react'
import TeamMember from './TeamMember'

function Team() {
    const pi = [
        {img: 'khaled1.jpg', name: 'Nour Homsi',     position: 'Graphic Designer',          phone: ' ',             website: 'www.esedu.fi',},
        {img: 'khaled2.jpg', name:'Khaled Alkilani', position: 'Junior Software Developer', phone: '045 207 8489',  website: 'www.esedu.fi',},
        {img: 'khaled1.jpg', name: 'Captin Majed',   position: 'IT Engineer',               phone: '044 550 8467'},
    ]

    const members = pi.map(function(member){
        // console.log(`<TeamMember ${member.name} />`);
        return <TeamMember
        img={member.img}
        name={member.name}
        position={member.position}
        phone={member.phone}
        website={member.website}
        />
    })

    return(
        <div className='row'>
        {members}
        </div>
    )
}

export default Team
